import './List.css';

const List = (props) => {
  const { listItems } = props;

  return (
    <div>
      {listItems.map((item) => (
        <div>
          <button className="todoItem" key={item.key}>
            {`${item.isCom} ${item.title}`}
          </button>
        </div>
      ))}
    </div>
  );
};

export default List;
